import { Grid } from '@material-ui/core';
import React from 'react'
import NavigationBar from '../components/NavigationBar.js';
import '../styles/Home.css';
import Footer from '../components/Footer.js';
import { makeStyles } from '@material-ui/core/styles';
import E_Board from '../components/Team/E_board';
import Director from '../components/Team/Director';
import VP from '../components/Team/VP';
import Tech_Team from '../components/Team/Tech_Team';
import Section_Head from '../components/Team/Section_Head.js';
import Team_Section from '../components/Team/Team_Section.js';
import Ambassador from '../components/Team/Ambassadors.js';
import PropTypes from 'prop-types';
import useScrollTrigger from '@material-ui/core/useScrollTrigger';
import Fab from '@material-ui/core/Fab';
import KeyboardArrowUpIcon from '@material-ui/icons/KeyboardArrowUp';
import Zoom from '@material-ui/core/Zoom';

const useStyles = makeStyles({
    root: {
    },
    head1: {
        background: '#fc9fb6',
        color: 'rgb(255, 255, 255)',
        marginBottom: '20px',
        paddingTop: '40px',
        paddingBottom: '40px',
        paddingLeft: '10%',
        paddingRight: '10%',
        "@media (max-width: 600px)": {
            paddingTop: '20px',
            paddingBottom: '20px',
        } 
    },
    head2: {
        background: 'rgb(173, 98, 117)',
        color: 'rgb(255, 255, 255)',
        marginBottom: '60px',
        marginTop: '80px',
        paddingTop: '40px',
        paddingBottom: '40px',
        paddingLeft: '10%',
        paddingRight: '10%',
        "@media (max-width: 600px)": {
            paddingTop: '20px',
            paddingBottom: '20px',
        } 
    },
    head3: {
        background:  'rgb(181, 196, 255);',
        color: 'rgb(255, 255, 255)',
        marginBottom: '60px',
        marginTop: '80px',
        paddingTop: '30px',
        paddingBottom: '30px',
        paddingLeft: '10%',
        paddingRight: '10%',
        "@media (max-width: 600px)": {
            paddingTop: '20px',
            paddingBottom: '20px',
        } 
    },
});

function ScrollTop(props) {
    const { children, window } = props;
    const classes = useStyles();
    // Note that you normally won't need to set the window ref as useScrollTrigger
    // will default to window.
    // This is only being set here because the demo is in an iframe.
    const trigger = useScrollTrigger({
      target: window ? window() : undefined,
      disableHysteresis: true,
      threshold: 100,
    });
  
    const handleClick = (event) => {
      const anchor = (event.target.ownerDocument || document).querySelector('#back-to-top-anchor');
  
      if (anchor) {
        anchor.scrollIntoView({ behavior: 'smooth', block: 'center' });
      }
    };
  
    return (
      <Zoom in={trigger}>
        <div onClick={handleClick} role="presentation" className={classes.root}>
          {children}
        </div>
      </Zoom>
    );
  }
  
  ScrollTop.propTypes = {
    children: PropTypes.element.isRequired,
    /**
     * Injected by the documentation to work in an iframe.
     * You won't need it on your project.
     */
    window: PropTypes.func,
  };

function Team(props) {
    const classes=useStyles();
    return (
        <>
        <Grid container direction="column" className={classes.root}>
            <Grid item>
                <NavigationBar/>
            </Grid>
            <Grid item className={classes.head1}>
                <Team_Section title="Executive Board"/>
            </Grid>
            <Grid item>
                <Section_Head title="Co-Founders/Co-Presidents"/>
            </Grid>
            <Grid item container>
                <Grid item xs={1} sm={1} md={2}/>
                <Grid item xs={10} sm={10} md={8} align="center">
                    <E_Board />
                </Grid>
                <Grid item xs={1} sm={1} md={2}/>
            </Grid>
            <Grid item>
                <Section_Head title="Directors"/>
            </Grid>
            <Grid item container>
                <Grid item xs={1} sm={1} md={2}/>
                <Grid item xs={10} sm={10} md={8} align="center">
                    <Director />
                </Grid>
                <Grid item xs={1} sm={1} md={2}/>
            </Grid>
            <Grid item>
                <Section_Head title="Vice Presidents"/>
            </Grid>
            <Grid item container>
                <Grid item xs={1} sm={1} md={2}/>
                <Grid item xs={10} sm={10} md={8} align="center">
                    <VP />
                </Grid>
                <Grid item xs={1} sm={1} md={2}/>
            </Grid>
            <Grid item className={classes.head2}>
                <Team_Section title="Tech-Team"/>
            </Grid>
            <Grid item container>
                <Grid item xs={1} sm={1} md={2}/>
                <Grid item xs={10} sm={10} md={8} align="center">
                    <Tech_Team />
                </Grid>
                <Grid item xs={1} sm={1} md={2}/>
            </Grid>
            <Grid item className={classes.head3}>
                <Team_Section title="Ambassadors"/>
            </Grid>
            <Grid item container>
                <Grid item xs={1} sm={1} />
                <Grid item xs={10} sm={10} align="center">
                    <Ambassador />
                </Grid>
                <Grid item xs={1} sm={1}/>
            </Grid>
            <Grid item>
                <br/><br/><br/>
            </Grid>
            <ScrollTop {...props}>
        <Fab color="secondary" size="small" aria-label="scroll back to top">
          <KeyboardArrowUpIcon />
        </Fab>
      </ScrollTop>
            <Grid item>
                <Footer/>
            </Grid>
        </Grid>
      </>
    )
}

export default Team
